import React from "react";
import {Layout, Menu, Dropdown} from "antd";
import {BrowserRouter} from "react-router-dom";
import {
    AppstoreFilled,
    BarsOutlined,
    CaretDownOutlined, FileTextOutlined,
    GiftOutlined,
    HomeOutlined, PictureOutlined, SettingOutlined, TagsOutlined, TeamOutlined
} from "@ant-design/icons";

const {Header, Content, Sider} = Layout;

const {SubMenu} = Menu;

class Frame extends React.Component {

    DownMenu = () => {
        return (
            <Menu>
                <Menu.Item key={"1"}>
                    <a>个人主页</a>
                </Menu.Item>
                <Menu.Item key={"2"}>
                    <a>退出登录</a>
                </Menu.Item>
            </Menu>
        )
    }

    render() {
        return (
            // BrowserRouter表示使用了histroy模式的路由，必须放在最外层
            <BrowserRouter>
                {/*使用顶部——侧边栏——通栏的布局*/}
                <Layout>
                    <Header className={"header"}>
                        <AppstoreFilled style={{color: "white", fontSize: "30px", marginTop: "17px", float: "left"}}/>
                        <div style={{
                            color: "white",
                            fontFamily: "微软雅黑",
                            fontSize: "25px",
                            float: "left",
                            marginLeft: "30px"
                        }}>装修小程序后台管理系统
                        </div>
                        <Dropdown overlay={this.DownMenu} trigger={["click"]}>
                            <a className={"ant-dropdown-link"} onClick={e => e.preventDefault()}
                               style={{color: "white", float: "right"}}>
                                张三<CaretDownOutlined/>
                            </a>
                        </Dropdown>
                    </Header>
                    <Layout>
                        <Sider width={200} className={"site-layout-background"}>
                            <Menu mode={"inline"} defaultSelectedKeys={["1"]} defaultOpenKeys={["1"]}
                                  style={{height: "100%", borderRight: 0}}>
                                <Menu.Item key={"1"} style={{marginTop:0}}><HomeOutlined/>&nbsp;&nbsp;系统首页</Menu.Item>
                                <Menu.Item key={"2"}><BarsOutlined/>&nbsp;&nbsp;预约管理</Menu.Item>
                                <Menu.Item key={"3"}><GiftOutlined/>&nbsp;&nbsp;活动管理</Menu.Item>
                                <Menu.Item key={"4"}><TagsOutlined/>&nbsp;&nbsp;分类管理</Menu.Item>
                                <Menu.Item key={"5"}><FileTextOutlined/>&nbsp;&nbsp;文章管理</Menu.Item>
                                <Menu.Item key={"6"}><PictureOutlined/>&nbsp;&nbsp;案例管理</Menu.Item>
                                <Menu.Item key={"7"}><SettingOutlined/>&nbsp;&nbsp;企业信息管理</Menu.Item>
                                <Menu.Item key={"8"}><TeamOutlined/>&nbsp;&nbsp;管理员管理</Menu.Item>
                            </Menu>
                        </Sider>
                        <Layout>
                            <div style={{width: "100%", height: "20px", backgroundColor: "white"}}></div>
                            <Layout style={{padding: "0 24px 24px"}}>
                                <Content className={"site-layout-background"}
                                         style={{padding: 24, minHeight: 280, marginTop: "10px"}}>

                                </Content>
                            </Layout>
                        </Layout>
                    </Layout>
                </Layout>
            </BrowserRouter>
        );
    }
}

export default Frame;
